INSERT INTO `t_merch` VALUES ('2c911f97622e0b2001622e17f7f40010', '2018-03-16 17:15:45 524', '4028819c5e08016c015e08098ec90003', '2018-05-22 15:31:23 171', '4028819c5e08016c015e08098ec90003', '对方公司担任公司人挺好', '2', '广州市', '张星', '越秀区', '18:00', '<img src=\"http://teststatic.jingxuanjiuba.com/2018-03-29/201803291537041485618077032592997.jpg\" alt=\"\" width=\"200\" height=\"356\" title=\"\" align=\"\" />fdsafsdfasdfsdafsdf搭嘎都是费', '23.128110', '113.381653', '艾迪康个好快方式', '15345789412', '312599', 'e10adc3949ba59abbe56e057f20f883e', '2c92041463720368016372b234750190;2c92041463720368016372b234bc0191;2c92041463720368016372b234e90192', '广东省', '123', '08:00', '3', '15324587487', '1', '9077c406804b4cf69ef897ef7415e3e9', '2c920414637203680163722567010032', '来的空间;玩儿;', '0.00', '', '', '', '0', '1');
INSERT INTO `t_merch` VALUES ('2c911f97622e0b2001622e19f4cc0021a', '2018-03-16 17:17:55 788', '4028819c5e08016c015e08098ec90003', '2018-09-07 19:18:21 387', '', '阅江西路222号', '2', '广州市', '沈聪聪', '海珠区', '20:00', '<p>\n	<img src=\"http://teststatic.jingxuanjiuba.com/2018-03-29/201803291624551645620948048813651.jpg\" alt=\"\" /><img src=\"http://teststatic.jingxuanjiuba.com/2018-03-29/201803291625044635620957348485525.jpg\" alt=\"\" /> \n</p>\n<p>\n	fdsafasfasdfasd发生的发生发的\n</p>\n<p>\n	<br />\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	“统一色彩、统一字体……只是这黑白配吧，一言难尽……”近日，一张商家“黑底配白字”的牌匾照片在微信朋友圈引发热议。3月27日，记者通过走访发现，昆明市西山区包括巡津街、书林街、环城路等多地沿街店面均换成了统一的牌匾，多为灰底黑字或黑底白字，不仅颜色、外形一样，还用了同一字体。\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	多名被更换牌匾的商户告诉记者，从去年开始，西山区政府对商户的牌匾进行了统一更换，具体由施工单位负责实施，此次更换牌匾并没有提前通知，也没有收费。\n</p>\n<p class=\"f_center\" style=\"font-size:16px;font-family:&quot;color:#404040;text-align:center;background-color:#FFFFFF;\">\n	<img alt=\"昆明一条街招牌统一黑白配 市民:太吓人 像办丧事\" id=\"7123972\" border=\"0\" align=\"center\" src=\"http://cms-bucket.nosdn.127.net/catchpic/8/8d/8d64c0df7d27d269cede6a2b0a4114ac.jpg?imageView&amp;thumbnail=550x0\" width=\"677\" height=\"385\" /><span>为了在“共性”中找“个性” 商家只好自己加牌证明是“不一样的烟火”</span> \n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	<strong>牌匾设计“一刀切” 商家埋怨多</strong> \n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	对于统一的牌匾，有的商家表示无所谓，有的则认为不好看。\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	在环城西路原毛纺厂附近，正在营业的电动车修理店老板表示，反正也是免费更换的，换了就换了，无所谓。\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	租了90平方米，正在卖一些生活用品的李老板告诉记者，他每个月的租金是7000元左右。“牌匾更换前没人商量，直接是政府统一更换的。而且换了有近一年的时间了，没有影响做生意。”\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	但有的商家则认为，商家悬挂牌匾和标识的重要目的就是便于客户识别，给人留下深刻印象，所以在制作时非常讲究色彩的运用和字体的设计。“这样子统一成一个颜色与字体，很分辨不出来哪家是哪家。”\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	记者在现场也看到，为了吸引过往人群的注意，有的商家除了悬挂统一牌匾外还在牌匾下方又悬挂了一个“特有”的牌匾。\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	“昭通小肉串”的老板表示，牌匾是去年统一更换的。“我们当时才花了800块钱做了一块招牌，没想到就直接用不成了，只能丢掉。早点告诉我们就不用花冤枉钱了。”另外，他表示，这个牌匾“不好看，也不显眼”。\n</p>\n<p class=\"f_center\" style=\"font-size:16px;font-family:&quot;color:#404040;text-align:center;background-color:#FFFFFF;\">\n	<img alt=\"昆明一条街招牌统一黑白配 市民:太吓人 像办丧事\" id=\"7123973\" border=\"0\" align=\"center\" src=\"http://cms-bucket.nosdn.127.net/catchpic/a/ab/ab3002dd50aa41a878eb3553aa5d1b28.jpg?imageView&amp;thumbnail=550x0\" width=\"674\" height=\"502\" /> \n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	<strong>市民：千篇一律 颜色搭配诡异</strong> \n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	西山区一些路段商家换成统一制作的整齐划一型牌匾，市民怎么看？\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	一位王姓市民对“黑底配白字”的牌匾有些不适，他认为：“之前的不同类型的牌匾确实显得有点乱，但是这个黑底配白字有点怪异。犯忌讳吧，看起来像是办丧事的感觉。”\n</p>\n<p style=\"font-size:16px;text-indent:2em;font-family:&quot;color:#404040;text-align:justify;background-color:#FFFFFF;\">\n	“灰底黑字有点丑，希望不要\n</p>\n<p>\n	<br />\n</p>', '23.105944', '113.323331', '沈聪聪的店1', '15487875775', '537784', 'e10adc3949ba59abbe56e057f20f883e', '2c92041463720368016372b1af360189;2c92041463720368016372b1b03e018a', '广东省', '23', '12:00', '3', '13548784577', '2', '', '2c92041463720368016372252299002d', '索然寡味而;噶而过;个人噶而过;爱的人噶而过;艾薇儿翁;', '0.00', 'http://thirdwx.qlogo.cn/mmopen/vi_32/7C10RLAxBpkqaMJKUxXs0u9DAnqqSc3icXAKGPjEuicBmfVeuxhkWoPNqA06csZtcQXb8shhtuvC29LOCxkdOibKw/132', '雨缘', 'oT0q00xuDNm5Czzoss3nMQxeY2U8', '0', '1');
